"use client"
import React, { useEffect, useState } from 'react'
import html2canvas from 'html2canvas';
import { IResponseData } from '../types/responseData';
import QRCode from "qrcode";

function Ebadge({ checkoutSessionId }: any) {
    const [buyerData, setBuyerData] = useState<IResponseData>(Object)
    const [qrSrc, setQrSrc] = useState('')
    const getBuyerData = async () => {
        try {
            setQrSrc(await QRCode.toDataURL(checkoutSessionId))
            await fetch('/api/payment-success', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(
                    {
                        checkoutSessionId,
                    }
                )
            }).then(response => response.json())
                .then(async data => {
                    setBuyerData(data)
                }).catch(error => {
                    console.log(error);
                });
        } catch (error) {
            alert(error)
        }
    }

    useEffect(() => {
        if (Object.keys(buyerData).length === 0) {
            getBuyerData()
        }

    }, [])

    const downloadAsPNG = async () => {
        const divElement = document.getElementById('e-badge');

        if (divElement) {
            const canvas = await html2canvas(divElement);
            const dataURL = canvas.toDataURL('image/png');
            const link = document.createElement('a');
            link.href = dataURL;
            link.download = 'e-badge.png';
            link.click();
        }
    };

    // useEffect(() => {
    //     // Call the function to capture the <div> and generate a downloadable PNG
    //     downloadAsPNG();
    // }, []);

    return (
        <>
            {Object.keys(buyerData).length !== 0 ?
                <>
                    <div id="e-badge" className="max-w-5xl p-6 mx-auto bg-white">
                        <div className="px-6 border border-gray-600 rounded-md sm:px-6 lg:px-8">
                            <div className='flex justify-between gap-x-2'>
                                <div className='flex flex-col justify-end py-4 mx-auto gap-x-4'>
                                    <h1 className="text-lg font-bold leading-8 text-lime-700 ">
                                        World Coffee Summit London
                                    </h1>
                                    <h2 className="leading-8 text-gray-900 text-md ">
                                        Delivering Collaborative Change: Impact of Regenerative Solutions
                                    </h2>
                                </div>
                                <div className='flex justify-end py-2 mx-auto gap-x-4'>
                                    <div className='my-auto'>
                                        <img className='h-[3rem] ' src={'data:image/png;base64,'}></img>
                                    </div>
                                    <div className='my-auto'>
                                        <img className='h-[5rem]' src={'data:image/png;base64,'}></img>
                                    </div>
                                    <div className='my-auto'>
                                        <img className='h-[1.5rem]' src={'data:image/png;base64,'}></img>
                                    </div>
                                </div>
                            </div>

                            <div className="flex flex-row w-full pb-6 text-center border-t-2 border-gray-400 border-dashed">
                                <div className='px-24 pt-4 border-r-2 border-gray-400 border-dashed'>
                                    <img className='h-[15rem]' src={qrSrc}></img>
                                </div>
                                <div className='py-8 mx-auto'>
                                    <h1 className="text-lg font-semibold leading-8 text-gray-900 ">
                                        13 September 2023
                                    </h1>
                                    <h1 className="mt-6 text-2xl font-semibold leading-8 text-gray-900 ">
                                        {buyerData.res.firstName} {buyerData.res.lastName}
                                    </h1>
                                    <h2 className="text-lg leading-8 text-gray-900">
                                        {buyerData.res.jobTitle}
                                    </h2>
                                    <h2 className="text-lg font-semibold leading-8 text-gray-900 ">
                                        {buyerData.res.companyName}
                                    </h2>
                                    <h3 className="mt-4 text-lg leading-8 text-gray-600">
                                        {buyerData.res.event === 'Summit' ? 'Delegate to the Summit' : 'Visitor to the Exhibition'}
                                    </h3>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="flex items-center justify-center mt-4 gap-x-6">
                        <button
                            onClick={(() => downloadAsPNG())}
                            className="rounded-md bg-lime-700 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-lime-800 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
                        >
                            Download e-Badge
                        </button>
                    </div>
                </>
                :
                <div className='mx-auto max-w-7xl'>
                    <h1 className="text-2xl font-semibold leading-8 text-gray-900 ">
                        Generating e-Badge ...
                    </h1>
                </div>}
        </>
    )
}

export default Ebadge